export const AddTask = () => {
  return (
    <section className="addtask">
      <form>
        <label htmlFor="">Task Name: </label>
        <input type="text" name="task" id="task" placeholder="Task Name" />
        <button type="submit">Add Task</button>
      </form>
    </section>
  );
};
